const mapStateToProps = state => {
    return { todoList: state.todoList };
};
const ConnectedList = ({ todoList }) => (
  <ul>
    {todoList.map(el => (
      <li key={el.id}>{el.content}</li>
    ))}
  </ul>
);

const List = connect(mapStateToProps)(ConnectedList)

export default List;
